    [],nt"revision_timestamp": "2016-08-01T23:32:38.123159",nt"name": "nodc-standard-format-microbiological-degradation-f059-data-1973-1980-nodc-accession-0014190",nt"isopen":
    false,nt"url": null,nt"notes": "This format is designed to support microbiological
    studies of bacteria, microbiota, and fungi. There are twelve data record types used
    to report cruise and station information, position and time, physical, chemical
    and environmental parameters, and data records for the microbiological studies.
    Each data record is 80 characters in length, sorted by station and sequence numbers
    to maintain the proper order. The first nine columns for all records are to be used
    for file type (columns 1-3) and file identifier (columns 4-9). The file identifier,
    to be assigned by the originator, is a unique originator id for each data submission.
    After submission, the NODC reassigns to this field a unique NODC identifier for
    internal use.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
